import React from 'react';
import LoginFrom from '../components/LoginForm';
import {Row, Col} from 'antd';

const Login = () => {
    return (

        <div style={{ display: 'block', backgroundColor: '#F3F5F7', height: '100vh' }}>
            <Row>
                <Col xs={24} md={5} >
                    {userId ? <UserProfile /> : <></>}
                </Col>

                <Col xs={24} md={18} >
                    {children}
                </Col>
            </Row>
            <LoginFrom />
        </div>

    );
};


export default Login;
